import React from 'react';
import MenuItem from '../menu-item/menuItem';

class Directory extends React.Component {
	constructor() {
		super();
		this.state = {
			sections: [
				{
					title: 'hats',
					imgUrl: 'null',
					id: 1,
					linkUrl: ''
				},
				{
					title: 'jackets',
					imgUrl: 'null',
					id: 2,
					linkUrl: ''
				},
				{
					title: 'shoes',
					imgUrl: 'null',
					id: 3,
					linkUrl: ''
				},
				{
					title: 'womens',
					imgUrl: 'null',
					id: 4,
					linkUrl: ''
				},
				{
					title: 'mens',
					imgUrl: 'null',
					id: 5,
					linkUrl: 'dd'
				}
			]
		};
	}

	render() {
		return (
			<div>
				{this.state.sections.map(({ title, id, linkUrl }) => (
					<MenuItem key={id} title={title} linkUrl={linkUrl} />
				))}
			</div>
		);
	}
}
export default Directory;
